pragma solidity ^0.5.0;

contract collegeRating{

  struct ratingStruct{
          uint[] deptId;
          mapping(uint => uint) deptRating;

        }  

  mapping (address => ratingStruct) deptRating;

  function setRating(address _collegeId, uint _deptId, uint _rating)
     public {

       deptRating[_collegeId].deptId.push(_deptId);
       deptRating[_collegeId].deptRating[_deptId] = _rating;

     }

}
